#include "globals.hpp"

void hexToRGB(const std::string& hexColor, int& r, int& g, int& b) {
    // Ensure the input starts with '#', if it does, skip it
    std::string color = (hexColor[0] == '#') ? hexColor.substr(1) : hexColor;

    // Convert the hex string to RGB values
    std::stringstream ss;
    ss << std::hex << color;

    unsigned int hexValue;
    ss >> hexValue;

    // Extract RGB components
    r = (hexValue >> 16) & 0xFF; // Red component
    g = (hexValue >> 8) & 0xFF;  // Green component
    b = hexValue & 0xFF;         // Blue component
}

